column8:
夜間走行も安心<br>
携帯ライトとしても使えます<br>
明るい5LEDライト<br>

工事不要！取り付け簡単！<br>
※ほとんどの自転車に取り付けれますが<br>
一部メーカーには取り付けられません。<br>
※完全防水機能はついてません<br>
雨の日のご使用は避けてください。<br>
単四電池4本使用<br>

自転車用LEDライト
高輝度白色LEDを5灯搭載した自転車用LEDライト。<br>
レバー式のブラケットは自転車への取り付<br>
けも取り外しもとても簡単です。<br>
連続点灯・点滅の2通りのライト点灯パターン<br>
で用途によって使い分けられます。
ブラケットからライト部分を取り外すと<br>
懐中電灯としても利用できます。<br><STYLE type="text/css">
